// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

/**
 * @title UniversityDiplomaSystem
 * @dev NFT-based diploma system with role-based access control
 * 
 * Features:
 * - Auto-incrementing token IDs (independent of student index)
 * - Multiple diplomas per student index (index is NOT unique)
 * - Automatic invalidation of old diplomas when new one is issued
 * - Role-based access: Admin, Student Service, Student
 * - Comprehensive event logging for all operations
 */
contract UniversityDiplomaSystem is ERC721URIStorage, AccessControl {
    using Counters for Counters.Counter;

    // ============ Role Definitions ============
    bytes32 public constant ADMIN_ROLE = DEFAULT_ADMIN_ROLE;
    bytes32 public constant STUDENT_SERVICE_ROLE = keccak256("STUDENT_SERVICE_ROLE");

    // ============ State Variables ============
    Counters.Counter private _tokenIdCounter;

    // Diploma data structure
    struct Diploma {
        string firstName;
        string lastName;
        string studentIndex;        // NOT unique - can repeat
        string fieldOfStudy;
        string grades;              // JSON string of grades
        uint256 credits;
        uint256 gpa;                // GPA * 100 (e.g., 850 = 8.50)
        uint256 graduationDate;     // Unix timestamp
        string transcriptData;      // JSON string of transcript
        bool isValid;
        uint256 issuedAt;
        address issuedBy;
    }

    // Mappings
    mapping(uint256 => Diploma) private _diplomas;
    mapping(string => uint256[]) private _indexToDiplomaIds;  // index -> array of tokenIds
    mapping(address => string[]) private _studentToIndices;    // student wallet -> indices

    // ============ Events for Logging ============
    event DiplomaIssued(
        uint256 indexed tokenId,
        string indexed studentIndex,
        address indexed student,
        address issuedBy,
        uint256 timestamp,
        string firstName,
        string lastName
    );

    event DiplomaInvalidated(
        uint256 indexed tokenId,
        string indexed studentIndex,
        address indexed invalidatedBy,
        uint256 timestamp,
        string reason
    );

    event DiplomaValidated(
        uint256 indexed tokenId,
        string indexed studentIndex,
        address indexed validatedBy,
        uint256 timestamp
    );

    event RoleGranted(
        address indexed account,
        bytes32 indexed role,
        address indexed grantedBy,
        uint256 timestamp
    );

    event RoleRevoked(
        address indexed account,
        bytes32 indexed role,
        address indexed revokedBy,
        uint256 timestamp
    );

    event DiplomaViewed(
        uint256 indexed tokenId,
        address indexed viewer,
        uint256 timestamp
    );

    event IndexQueried(
        string indexed studentIndex,
        address indexed queriedBy,
        uint256 timestamp,
        uint256 diplomaCount
    );

    // ============ Constructor ============
    constructor(
        address adminAddress,
        address studentServiceAddress
    ) ERC721("University Diploma", "DIPLOMA") {
        // Grant roles
        _grantRole(ADMIN_ROLE, adminAddress);
        _grantRole(STUDENT_SERVICE_ROLE, adminAddress);
        _grantRole(STUDENT_SERVICE_ROLE, studentServiceAddress);
        
        // Start token counter at 1
        _tokenIdCounter.increment();
    }

    // ============ Core Functions ============

    /**
     * @dev Issue a new diploma NFT
     * @notice Automatically invalidates previous diplomas with same index
     * Requirements:
     * - Caller must have STUDENT_SERVICE_ROLE
     * - All required fields must be provided
     */
    function issueDiploma(
        address studentAddress,
        string memory firstName,
        string memory lastName,
        string memory studentIndex,
        string memory fieldOfStudy,
        string memory grades,
        uint256 credits,
        uint256 gpa,
        uint256 graduationDate,
        string memory transcriptData,
        string memory tokenURI
    ) external onlyRole(STUDENT_SERVICE_ROLE) returns (uint256) {
        require(studentAddress != address(0), "Invalid student address");
        require(bytes(studentIndex).length > 0, "Index required");
        require(bytes(firstName).length > 0, "First name required");
        require(bytes(lastName).length > 0, "Last name required");

        // Get current token ID and increment for next use
        uint256 tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();

        // Invalidate all previous diplomas with same index
        uint256[] storage existingDiplomas = _indexToDiplomaIds[studentIndex];
        for (uint256 i = 0; i < existingDiplomas.length; i++) {
            uint256 existingTokenId = existingDiplomas[i];
            if (_diplomas[existingTokenId].isValid) {
                _diplomas[existingTokenId].isValid = false;
                
                emit DiplomaInvalidated(
                    existingTokenId,
                    studentIndex,
                    msg.sender,
                    block.timestamp,
                    "Superseded by new diploma"
                );
            }
        }

        // Mint NFT
        _safeMint(studentAddress, tokenId);
        _setTokenURI(tokenId, tokenURI);

        // Store diploma data
        _diplomas[tokenId] = Diploma({
            firstName: firstName,
            lastName: lastName,
            studentIndex: studentIndex,
            fieldOfStudy: fieldOfStudy,
            grades: grades,
            credits: credits,
            gpa: gpa,
            graduationDate: graduationDate,
            transcriptData: transcriptData,
            isValid: true,
            issuedAt: block.timestamp,
            issuedBy: msg.sender
        });

        // Add to index mapping
        _indexToDiplomaIds[studentIndex].push(tokenId);
        
        // Add to student indices
        _studentToIndices[studentAddress].push(studentIndex);

        emit DiplomaIssued(
            tokenId,
            studentIndex,
            studentAddress,
            msg.sender,
            block.timestamp,
            firstName,
            lastName
        );

        return tokenId;
    }

    /**
     * @dev Invalidate a diploma
     * @notice Admin can invalidate any diploma
     */
    function invalidateDiploma(
        uint256 tokenId,
        string memory reason
    ) external onlyRole(ADMIN_ROLE) {
        require(_exists(tokenId), "Diploma does not exist");
        require(_diplomas[tokenId].isValid, "Already invalid");

        _diplomas[tokenId].isValid = false;

        emit DiplomaInvalidated(
            tokenId,
            _diplomas[tokenId].studentIndex,
            msg.sender,
            block.timestamp,
            reason
        );
    }

    /**
     * @dev Re-validate a diploma
     * @notice Admin can re-validate a diploma if needed
     */
    function validateDiploma(uint256 tokenId) external onlyRole(ADMIN_ROLE) {
        require(_exists(tokenId), "Diploma does not exist");
        require(!_diplomas[tokenId].isValid, "Already valid");

        _diplomas[tokenId].isValid = true;

        emit DiplomaValidated(
            tokenId,
            _diplomas[tokenId].studentIndex,
            msg.sender,
            block.timestamp
        );
    }

    // ============ Query Functions ============

    /**
     * @dev Get diploma by token ID
     */
    function getDiploma(uint256 tokenId) external returns (
        string memory firstName,
        string memory lastName,
        string memory studentIndex,
        string memory fieldOfStudy,
        string memory grades,
        uint256 credits,
        uint256 gpa,
        uint256 graduationDate,
        string memory transcriptData,
        bool isValid,
        uint256 issuedAt,
        address issuedBy,
        address owner
    ) {
        require(_exists(tokenId), "Diploma does not exist");

        Diploma memory diploma = _diplomas[tokenId];

        emit DiplomaViewed(tokenId, msg.sender, block.timestamp);

        return (
            diploma.firstName,
            diploma.lastName,
            diploma.studentIndex,
            diploma.fieldOfStudy,
            diploma.grades,
            diploma.credits,
            diploma.gpa,
            diploma.graduationDate,
            diploma.transcriptData,
            diploma.isValid,
            diploma.issuedAt,
            diploma.issuedBy,
            ownerOf(tokenId)
        );
    }

    /**
     * @dev Get all diploma token IDs for a student index
     * @notice Returns ALL diplomas for the index (valid and invalid)
     */
    function getDiplomasByIndex(string memory studentIndex) 
        external 
        returns (uint256[] memory) 
    {
        uint256[] memory tokenIds = _indexToDiplomaIds[studentIndex];
        
        emit IndexQueried(
            studentIndex,
            msg.sender,
            block.timestamp,
            tokenIds.length
        );

        return tokenIds;
    }

    /**
     * @dev Get only valid diploma for an index
     */
    function getValidDiplomaByIndex(string memory studentIndex) 
        external 
        view 
        returns (uint256) 
    {
        uint256[] memory tokenIds = _indexToDiplomaIds[studentIndex];
        
        for (uint256 i = tokenIds.length; i > 0; i--) {
            uint256 tokenId = tokenIds[i - 1];
            if (_diplomas[tokenId].isValid) {
                return tokenId;
            }
        }
        
        revert("No valid diploma found");
    }

    /**
     * @dev Get all indices for a student wallet
     */
    function getStudentIndices(address studentAddress) 
        external 
        view 
        returns (string[] memory) 
    {
        return _studentToIndices[studentAddress];
    }

    /**
     * @dev Check if diploma is valid
     */
    function isValid(uint256 tokenId) external view returns (bool) {
        require(_exists(tokenId), "Diploma does not exist");
        return _diplomas[tokenId].isValid;
    }

    /**
     * @dev Get total number of issued diplomas
     */
    function totalSupply() external view returns (uint256) {
        return _tokenIdCounter.current() - 1;
    }

    // ============ Role Management ============

    /**
     * @dev Grant role to address (Admin only)
     */
    function grantRoleWithLog(address account, bytes32 role) 
        external 
        onlyRole(ADMIN_ROLE) 
    {
        grantRole(role, account);
        
        emit RoleGranted(
            account,
            role,
            msg.sender,
            block.timestamp
        );
    }

    /**
     * @dev Revoke role from address (Admin only)
     */
    function revokeRoleWithLog(address account, bytes32 role) 
        external 
        onlyRole(ADMIN_ROLE) 
    {
        revokeRole(role, account);
        
        emit RoleRevoked(
            account,
            role,
            msg.sender,
            block.timestamp
        );
    }

    /**
     * @dev Check if address has admin role
     */
    function isAdmin(address account) external view returns (bool) {
        return hasRole(ADMIN_ROLE, account);
    }

    /**
     * @dev Check if address has student service role
     */
    function isStudentService(address account) external view returns (bool) {
        return hasRole(STUDENT_SERVICE_ROLE, account);
    }

    // ============ Required Overrides ============

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721URIStorage, AccessControl)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}

